import { StyleSheet,Dimensions } from "react-native";
const workersCountStyle = StyleSheet.create({
    div:{
        backgroundColor:'#313E4D',
        borderRadius:15,
        width:Dimensions.get('window').width - 40,
        paddingBottom:10,
        paddingTop:10,
        marginTop:15,
        textAlign:'center'
    }
})
export {workersCountStyle};
